import React, {Component} from 'react';
import TicTacItem from "./components/TicTacItem";
function f(e:any):void{
    console.log(e);
}
class App extends Component {
    render() {
        return (
            <div
                style={{
                    border:'1px solid red',
                    display:'flex',
                    justifyContent:'center',
                    alignItems:'center',
                    width:'100%',
                    height:'100%',
                    top:'0',
                    left:'0',
                    position:'fixed'

                }}
            >
                <TicTacItem onClick={()=>{console.log('hi')}} onMouseEnterFunc={()=>{f(this)}}/>
            </div>
        );
    }
}

export default App;
